import {useState} from "react"
import { Todo } from "../types";
import BaseModelWrapper from "./BaseModelWrapper";

interface TodoProps {
  todo: Todo;
  // month: number
}


const TodoHolder = (props: TodoProps)  => {
  console.log(props.todo);
  const [modalVisible, setModalVisible] = useState<boolean>(false)

  const toggleModal = (): void => {
    setModalVisible(!modalVisible)
  }

  return (
    <div>
      <div id={props.todo.id}>{props.todo.title}</div>
      <BaseModelWrapper isModalVisible={modalVisible} onBackdropClick={toggleModal}/>
    </div>

  )
};

export default TodoHolder
